import React, { useState, useEffect } from 'react';
import axios from 'axios';

const CardGallery = () => {
  const [cards, setCards] = useState([]);

  useEffect(() => {
    // Make API request to Scryfall to get cards from a set
    const fetchCards = async () => {
      try {
        const response = await axios.get('https://api.scryfall.com/cards/search?q=set%3Athb');
        setCards(response.data.data); // assuming response data is an array of card objects
      } catch (error) {
        console.error('Error fetching cards:', error);
      }
    };
    fetchCards();
  }, []);

  return (
    <div>
      <h1>Card Gallery</h1>
      {cards.map(card => (
        <div key={card.id}>
          <img src={card.image_uris.small} alt={card.name} />
        </div>
      ))}
    </div>
  );
};

export default CardGallery;
